import {AppDiv,CardInnerDiv,CardOuterDiv,CenterAppbar,StyledImage,StyledLink} from "./Dashboard.styles"
import tataimage from "../../assets/pngs/Final logo - Tata motors .png"
import photo from "../../assets/logos/Logo_with_text.svg"
import berrysimage from "../../assets/pngs/Berrys.png";
import proto from "../../assets/pngs/Proto.png";
import CardComponent from './DashboardComponents/CardComponent';

const cardsData=[{
    id:1,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000", 
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"

},{ 
    id:2,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Proto D Industries",  
    imageSeller:proto,
    unitcost:"10,000",
    xirr:"15.09%",
    totalunit:"500",
    remainingunit:"134", 
    tenure:"60"

},
{   
    id:3,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
},
{   
    id:4,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
},{ 
    id:5,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
},{
    id:6,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
}]

export const Dashboard: React.FC<DashboardProps> = ( {id,imageBuyer,buyer,seller ,imageSeller,tenure,unitcost,totalunit,xirr, remainingunit}) => {
    return (
      <FullScreenContainer>
        <AppDiv>
            <StyledImage src={photo}></StyledImage>
          <CenterAppbar>
            
          </CenterAppbar>
          <div>
            <StyledLink to="/login"> Login</StyledLink>
            
            <StyledLink to="/signup"> Signup</StyledLink>
            
            {/* here i will add the functionality of sign out */}
          </div>
          
        </AppDiv>

        <CardOuterDiv>
        {cardsData.map((card) => (
        <CardComponent
          id={card.id}
          imageBuyer={card.imageBuyer}
          buyer={card.buyer}
          seller={card.seller}
          imageSeller={card.imageSeller}
          unitcost={card.unitcost}
          xirr={card.xirr}
          totalunit={card.totalunit}
          remainingunit={card.remainingunit}
          tenure={card.tenure}
        //   onBuyNow={handleBuyNow}

        />
      ))}
        </CardOuterDiv>
      </FullScreenContainer>
    );
  };
